import React, { useState, useRef, useEffect } from 'react';
import { Link } from 'react-router-dom';
import { useAuth } from '../context/AuthContext.js';
import { FiUser, FiShoppingBag, FiLogOut, FiSettings, FiHeart, FiCreditCard } from 'react-icons/fi';
import './ProfileIcon.css';

const ProfileIcon = () => {
  const { user, logout } = useAuth();
  const [isOpen, setIsOpen] = useState(false);
  const dropdownRef = useRef(null);

  // Get first letter of user's name for avatar
  const getInitial = () => {
    if (!user || !user.name) return 'U';
    return user.name.charAt(0).toUpperCase();
  };

  // Get user's name or email
  const getUserName = () => {
    if (!user) return 'User';
    return user.name || user.email || 'User';
  };

  // Toggle dropdown menu
  const toggleDropdown = () => {
    setIsOpen(!isOpen);
  };

  // Close dropdown when clicking outside
  useEffect(() => {
    const handleClickOutside = (event) => {
      if (dropdownRef.current && !dropdownRef.current.contains(event.target)) {
        setIsOpen(false);
      }
    };

    document.addEventListener('mousedown', handleClickOutside);
    return () => {
      document.removeEventListener('mousedown', handleClickOutside);
    };
  }, []);

  // Handle logout
  const handleLogout = () => {
    logout();
    setIsOpen(false);
  };

  return (
    <div className="profile-icon-container" ref={dropdownRef}>
      <button className="profile-icon-button" onClick={toggleDropdown}>
        {user && user.profileImage ? (
          <img 
            src={user.profileImage} 
            alt={getUserName()}
            className="profile-avatar" 
          />
        ) : (
          <div className="profile-avatar profile-initial">
            {getInitial()}
          </div>
        )}
      </button>

      {isOpen && (
        <div className="profile-dropdown">
          <div className="profile-header">
            <div className="profile-avatar profile-initial-large">
              {getInitial()}
            </div>
            <div className="profile-info">
              <p className="profile-name">{getUserName()}</p>
              <p className="profile-email">{user?.email || 'No email'}</p>
            </div>
          </div>

          <ul className="profile-menu">
            <li>
              <Link to="/profile" className="profile-menu-item">
                <FiUser className="profile-menu-icon" />
                <span>Profile</span>
              </Link>
            </li>
            <li>
              <Link to="/orders" className="profile-menu-item">
                <FiShoppingBag className="profile-menu-icon" />
                <span>Your Orders</span>
              </Link>
            </li>
            <li>
              <Link to="/favorites" className="profile-menu-item">
                <FiHeart className="profile-menu-icon" />
                <span>Favorites</span>
              </Link>
            </li>
            <li>
              <Link to="/payment" className="profile-menu-item">
                <FiCreditCard className="profile-menu-icon" />
                <span>Payment Methods</span>
              </Link>
            </li>
            <li>
              <Link to="/settings" className="profile-menu-item">
                <FiSettings className="profile-menu-icon" />
                <span>Settings</span>
              </Link>
            </li>
          </ul>

          <div className="profile-footer">
            <button className="logout-button" onClick={handleLogout}>
              <FiLogOut className="profile-menu-icon" />
              <span>Logout</span>
            </button>
          </div>
        </div>
      )}
    </div>
  );
};

export default ProfileIcon;
